import * as authActions from '../actions/index'
const { GET_TOKEN, SET_TOKEN } = authActions.auth

//초기 토큰 설정
const defaultSate ={
    token: null
}
export default AuthReducer = (state = defaultSate, action) =>{


    switch (action.type){
        case GET_TOKEN:
            return state
        case SET_TOKEN:
            return state

        // 초기 상태는 default에서 정합니다.
        default:
            // console.log('default');
            return state
    }
}
